import React from 'react';
import { pageLinks } from '../data';

const PageLink = () => {
  return (
    <ul className='nav-links'>
      {pageLinks.map((link) => {
        return (
          <li key={link.id}>
            <a href={link.href} className='nav-link'>
              {link.text}
            </a>
          </li>
        );
      })}
    </ul>
  );
};

export default PageLink;
